var moment=require("../../moment");exports.gettersSetters={setUp:function(a){moment.createFromInputFallback=function(){throw new Error("input not handled by moment")};a()},getters:function(c){c.expect(8);var b=moment([2011,9,12,6,7,8,9]);c.equal(b.year(),2011,"year");c.equal(b.month(),9,"month");c.equal(b.date(),12,"date");c.equal(b.day(),3,"day");c.equal(b.hours(),6,"hour");c.equal(b.minutes(),7,"minute");c.equal(b.seconds(),8,"second");c.equal(b.milliseconds(),9,"milliseconds");c.done()},"getters programmatic":function(c){var b=moment([2011,9,12,6,7,8,9]);c.equal(b.get("year"),2011,"year");c.equal(b.get("month"),9,"month");c.equal(b.get("date"),12,"date");c.equal(b.get("day"),3,"day");c.equal(b.get("hour"),6,"hour");c.equal(b.get("minute"),7,"minute");c.equal(b.get("second"),8,"second");c.equal(b.get("milliseconds"),9,"milliseconds");c.equal(b.get("weekday"),b.weekday(),"weekday");c.equal(b.get("isoWeekday"),b.isoWeekday(),"isoWeekday");c.equal(b.get("week"),b.week(),"week");c.equal(b.get("isoWeek"),b.isoWeek(),"isoWeek");c.equal(b.get("dayOfYear"),b.dayOfYear(),"dayOfYear");c.done()},"setters plural":function(c){c.expect(8);var b=moment();b.years(2011);b.months(9);b.dates(12);b.hours(6);b.minutes(7);b.seconds(8);b.milliseconds(9);c.equal(b.years(),2011,"years");c.equal(b.months(),9,"months");c.equal(b.dates(),12,"dates");c.equal(b.days(),3,"days");c.equal(b.hours(),6,"hours");c.equal(b.minutes(),7,"minutes");c.equal(b.seconds(),8,"seconds");c.equal(b.milliseconds(),9,"milliseconds");c.done()},"setters singular":function(c){c.expect(8);var b=moment();b.year(2011);b.month(9);b.date(12);b.hour(6);b.minute(7);b.second(8);b.millisecond(9);c.equal(b.year(),2011,"year");c.equal(b.month(),9,"month");c.equal(b.date(),12,"date");c.equal(b.day(),3,"day");c.equal(b.hour(),6,"hour");c.equal(b.minute(),7,"minute");c.equal(b.second(),8,"second");c.equal(b.millisecond(),9,"milliseconds");c.done()},setters:function(c){c.expect(9);var b=moment();b.year(2011);b.month(9);b.date(12);b.hours(6);b.minutes(7);b.seconds(8);b.milliseconds(9);c.equal(b.year(),2011,"year");c.equal(b.month(),9,"month");c.equal(b.date(),12,"date");c.equal(b.day(),3,"day");c.equal(b.hours(),6,"hour");c.equal(b.minutes(),7,"minute");c.equal(b.seconds(),8,"second");c.equal(b.milliseconds(),9,"milliseconds");b=moment("20130531","YYYYMMDD");b.month(3);c.equal(b.month(),3,"month edge case");c.done()},"setter programmatic":function(c){var b=moment();b.set("year",2011);b.set("month",9);b.set("date",12);b.set("hours",6);b.set("minutes",7);b.set("seconds",8);b.set("milliseconds",9);c.equal(b.year(),2011,"year");c.equal(b.month(),9,"month");c.equal(b.date(),12,"date");c.equal(b.day(),3,"day");c.equal(b.hours(),6,"hour");c.equal(b.minutes(),7,"minute");c.equal(b.seconds(),8,"second");c.equal(b.milliseconds(),9,"milliseconds");b=moment("20130531","YYYYMMDD");b.month(3);c.equal(b.month(),3,"month edge case");c.done()},"setters strings":function(c){c.expect(7);var b=moment([2012]).locale("en");c.equal(b.clone().day(0).day("Wednesday").day(),3,"day full name");c.equal(b.clone().day(0).day("Wed").day(),3,"day short name");c.equal(b.clone().day(0).day("We").day(),3,"day minimal name");c.equal(b.clone().day(0).day("invalid").day(),0,"invalid day name");c.equal(b.clone().month(0).month("April").month(),3,"month full name");c.equal(b.clone().month(0).month("Apr").month(),3,"month short name");c.equal(b.clone().month(0).month("invalid").month(),0,"invalid month name");c.done()},"setters - falsey values":function(c){c.expect(1);var b=moment();b.minutes(1);b.minutes(0);c.equal(b.minutes(),0,"falsey value");c.done()},"chaining setters":function(c){c.expect(7);var b=moment();b.year(2011).month(9).date(12).hours(6).minutes(7).seconds(8);c.equal(b.year(),2011,"year");c.equal(b.month(),9,"month");c.equal(b.date(),12,"date");c.equal(b.day(),3,"day");c.equal(b.hours(),6,"hour");c.equal(b.minutes(),7,"minute");c.equal(b.seconds(),8,"second");c.done()},"day setter":function(c){c.expect(18);var b=moment([2011,0,15]);c.equal(moment(b).day(0).date(),9,"set from saturday to sunday");c.equal(moment(b).day(6).date(),15,"set from saturday to saturday");c.equal(moment(b).day(3).date(),12,"set from saturday to wednesday");b=moment([2011,0,9]);c.equal(moment(b).day(0).date(),9,"set from sunday to sunday");c.equal(moment(b).day(6).date(),15,"set from sunday to saturday");c.equal(moment(b).day(3).date(),12,"set from sunday to wednesday");b=moment([2011,0,12]);c.equal(moment(b).day(0).date(),9,"set from wednesday to sunday");c.equal(moment(b).day(6).date(),15,"set from wednesday to saturday");c.equal(moment(b).day(3).date(),12,"set from wednesday to wednesday");c.equal(moment(b).day(-7).date(),2,"set from wednesday to last sunday");c.equal(moment(b).day(-1).date(),8,"set from wednesday to last saturday");c.equal(moment(b).day(-4).date(),5,"set from wednesday to last wednesday");c.equal(moment(b).day(7).date(),16,"set from wednesday to next sunday");c.equal(moment(b).day(13).date(),22,"set from wednesday to next saturday");c.equal(moment(b).day(10).date(),19,"set from wednesday to next wednesday");c.equal(moment(b).day(14).date(),23,"set from wednesday to second next sunday");c.equal(moment(b).day(20).date(),29,"set from wednesday to second next saturday");c.equal(moment(b).day(17).date(),26,"set from wednesday to second next wednesday");c.done()}};